import React, { Component } from 'react';
import './App.js';

class Amanda extends Component {
  render() {
    return(
      <div>
      <h1>Amanda Zotelli</h1>
      <p>Oi, eu sou a Amanda</p>
      </div>
    );
  };
};

export default Amanda;
